var allNodes = $('*');
var colors = [];
var existingColors = [];
var colorCount = [];
var results = {};


/**
 * Create a list of colors with the follow points:
 *    1. css property
 *    2. color
 *    3. zepto node
 *
 * @private
 */
function generateColorTheme () {

  _.map(allNodes, function(n) {

    var nColor = $(n).css('color');
    var nTextLength = $(n).text().trim().length;
    var nBgColor = $(n).css('background-color');
    var nBgColorVisible = $(n).css('visibility');
    var nBorderColor = $(n).css('border-color');
    var nBorderColorWidth = $(n).css('border-width');
    var nBorderRightColor = $(n).css('border-right-color');
    var nBorderRightWidth = $(n).css('border-right-width');
    var nBorderBottomColor = $(n).css('border-bottom-color');
    var nBorderBottomWidth = $(n).css('border-bottom-width');
    var nBorderLeftColor = $(n).css('border-left-color');
    var nBorderLeftWidth = $(n).css('border-left-width');
    var nBorderTopColor = $(n).css('border-top-color');
    var nBorderTopWidth = $(n).css('border-top-width');
    var nCssSelector = getCssSelector($(n));

    if (colorExists(nColor, nTextLength)) {
      colors.push({ 'css' : 'color', 'color' : nColor, 'node' : nCssSelector });
    }

    if (bgExists(nBgColor, nBgColorVisible)) {
      colors.push({ 'css' : 'background-color', 'color' : nBgColor, 'node' : nCssSelector });
    }

    if (borderExists(nBorderColorWidth)) {
      colors.push({ 'css' : 'border', 'color' : nBorderColor, 'node' : nCssSelector });

    } else {

      if (borderExists(nBorderRightWidth)) {
        colors.push({ 'css' : 'border-right', 'color' : nBorderRightColor, 'node' : nCssSelector });
      }

      if (borderExists(nBorderBottomWidth)) {
        colors.push({ 'css' : 'border-bottom', 'color' : nBorderBottomColor, 'node' : nCssSelector });
      }

      if (borderExists(nBorderLeftWidth)) {
        colors.push({ 'css' : 'border-left', 'color' : nBorderLeftColor, 'node' : nCssSelector });
      }

      if (borderExists(nBorderTopWidth)) {
        colors.push({ 'css' : 'border-top', 'color' : nBorderTopColor, 'node' : nCssSelector });
      }
    }
  });
}


/**
 * Get all class names and ids from this dom object
 *
 * @param {Object} dom object
 *
 * @private
 */
function getDomIds (o) {
  var nodeClassName =''
  var nodeId = '';
  if (o.className != undefined && o.className != '' && validClassOrId(o.className)) {
    console.log(o.className);
    nodeClassName = '.' + o.className.trim().replace(/\s{1,}/g, '.');
  } else if (o.id != undefined && o.id != '' && validClassOrId(o.id)) {
    nodeId = '#' + o.id;
  }
  if (nodeClassName === undefined) {
    console.log(nodeClassName);
  }
  return nodeClassName + nodeId;
}


/**
 * Return CSS selector and all its parents
 *
 * @param {Object} zepto object for node in question
 *
 * @private
 */
function getCssSelector (n) {
  var selector = '';
  var x = $(n).parents();
  _.map(x, function(o) {
    // var classesAndId = getDomIds(o).length > 0 ? getDomIds(o) : '';
    // var node = o.localName + getDomIds(o); + ' ';
      var nodeClassName =''
    var nodeId = '';
    if (o.className != undefined && o.className != '' && validClassOrId(o.className)) {
      nodeClassName = '.' + o.className.trim().replace(/\s{1,}/g, '.');
    } else if (o.id != undefined && o.id != '' && validClassOrId(o.id)) {
      nodeId = '#' + o.id;
    }
    var node = o.localName + nodeClassName + nodeId + ' ';
    selector = node.concat(selector);
  });

  selector = selector.concat($(n).prop("tagName"));
  return selector;
};


/**
 * Makes sure the class name or id is valid
 *
 * @param {String} class or id
 *
 * @private
 */
function validClassOrId(c) {
  return c != undefined && c != '' && (/^([a-z_]|-[a-z_-])[a-z\d_-]*$/i).test(c);
}


/**
 * Return a Boolean based on whether color is valid
 *
 * @param {String} color
 * @param {String} length of word
 *
 * @private
 */
function colorExists (n, nTextLength) {
  return n != '' && nTextLength != 0 && n != 'initial' && n != 'transparent';
};


/**
 * Return a Boolean based on whether gradient is valid
 *
 * @param {String} color
 *
 * @private
 */
function isGradient (n) {
  return n.split('rgb').length > 2 && n != 'initial' && n != 'transparent';
};


/**
 * Return a Boolean based on whether background is valid
 *
 * @param {String} background color
 * @param {String} css result for 'visibility'
 *
 * @private
 */
function bgExists (n, nBgColorVisible) {
  return n != '' && nBgColorVisible == 'visible' && n != 'rgba(0, 0, 0, 0)' && n != 'initial' && n != 'transparent';
};


/**
 * Return a Boolean based on whether border is valid
 *
 * @param {String} pixel count
 *
 * @private
 */
function borderExists (n) {
  return n != '0px' && n != 'initial';
};


/**
 * Iterate through all of the colors and:
 *    1. Create a list of unique colors
 *    2. Count the number of instances of colors
 *
 * @param {List[String]} all of the colors
 *
 * @private
 */
function countColors (colors) {
  _.map(colors, function(c) {
    if (!_.contains(existingColors, c.color)) {
      existingColors.push(c.color);
      colorCount.push({'color' : c.color, 'count' : 1});
    } else {
      var e = _.find(colorCount, function(i) { return i.color == c.color });
      if (e) { e.count = e.count + 1; }
    }
  });
  return existingColors;
};


/**
 * Sort all of the colors by their count
 *
 * @param {List[String]} all of the colors
 *
 * @private
 */
function sortColors (colorCount) {
  colorCount.sort(function(a, b) {
    if (a.count < b.count) {
      return 1;
    } else {
      return -1;
    }
  });
};


/**
 * Instantiate
 *
 * @private
 */
$(document).ready(function() {
  generateColorTheme();
  countColors(colors);
  sortColors(colorCount);
});


/**
 * Return results with:
 *  1. List of all existing colors and their counts
 *  2. List of nodes with their color properties
 */
var results = {
  'colorCount': colorCount,
  'colors' : colors,
  'website' : location.href
};
results;